# Create leads in batches for better performance
puts "Creating #{leads_data.length} leads..."
created_count = 0
error_count = 0

leads_data.each_slice(100) do |batch|
  begin
    Lead.create!(batch)
    created_count += batch.length
    print "."
  rescue => e
    puts "\nError creating batch: #{e.message}"
    # Try individual creates for this batch
    batch.each do |lead_attrs|
      begin
        Lead.create!(lead_attrs)
        created_count += 1
      rescue => individual_error
        puts "Failed to create lead: #{lead_attrs[:phone]} - #{individual_error.message}"
        error_count += 1
      end
    end
  end
end

puts "\nCompleted! Created #{created_count} leads. Errors: #{error_count}"
